function Notice({ noticeNumber }) {

    const noticeScale = [
        {1: 'mauvais'},
        {2: 'médiocre'},
        {3: 'bon'},
        {4: 'très bon'},
        {5: 'excellent'}
    ]

    return (
        <div> 
            {noticeScale.map((notice) =>
                <span key={`${notice}`}>{notice}</span>
            )} 
        </div>
    )
}

export default Notice
